import changeTodoDescription from '../actions/changeTodoDescription.action';

const initState = {
    todoDescription: '',
};

const createTodoReducer = (state = initState, action) => {
    switch (action.type) {
        case 'changeTodoDescription':
            return changeTodoDescription(state, action);
        default:
            return state;
    }
}

export default createTodoReducer;
